import React from "react";
import { connect } from "react-redux";
import { Route, Redirect } from "react-router-dom";
const UserRoute = (props) => {
	if (props.user) {
		return <Route {...props} />;
	}
	return <Redirect to="/" />;
};

export default connect(({ user }) => ({ user }))(UserRoute);
